-- ----------------------------
-- Table structure for sys_notice_record
-- ----------------------------
DROP TABLE IF EXISTS `sys_notice_record`;
CREATE TABLE `sys_notice_record`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `user_id` bigint(20) NOT NULL COMMENT '用户id',
  `sys_notice_id` bigint(20) NOT NULL COMMENT '公告id',
  `create_date` datetime(0) NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 4 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '公告查看记录表' ROW_FORMAT = Dynamic;

